script: |
  super -f text -I q9573.spq | sort > q9573.out

inputs:
  - name: q9573.spq
    data: |
      SELECT DISTINCT - col1 / - 29 FROM tab2 (FORMAT parquet) WHERE col1 - + 42 NOT BETWEEN - col0 * ( + col2 ) AND + - col0 + 13 + - + 81;
  - name: tab2

outputs:
  - name: q9573.out
    data: |
      1
      2
